-- ----------------------------
-- Table structure for users
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `nickname` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '微信昵称',
  `gender` tinyint(4) DEFAULT '1',
  `avatar` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'http://www.gravatar.com/avatar' COMMENT '头像',
  `phone` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '电话',
  `weixin_openid` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '微信授权',
  `weixin_session_key` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `victory_total` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '个人总业绩',
  `victory_current` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当月业绩',
  `spend_total` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '个人总消费',
  `spend_current` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当月消费',
  `integral_total` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '个人总积分',
  `integral_current` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当前积分',
  `m_total` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '个人总M币',
  `m_current` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当前M币',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '身份 0=游客，1=申请会员， 2=会员',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `session_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `parent_id` int(10) NOT NULL DEFAULT '0' COMMENT '上级，默认为0,暂无上级，1=平台推荐，',
  `wechat` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '微信号',
  `areas` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_weixin_openid_unique` (`weixin_openid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

